import Card from '../UI/Card'
const ProductItem= (props) =>{
    return(
        <li>
            <Card>
                <div>
                    <img src={props.img}/>
                    <div className="product-detail">
                        <h4 className="prod-name">{props.name}</h4>
                        <p className="rating"></p>
                        <p className="prod-price"></p>
                    </div>
                </div>
            </Card>
        </li>
    );
};

export default ProductItem;
